import React, { useState } from 'react';
import styled from 'styled-components';
import * as dateFns from 'date-fns';
import { breakpoints } from 'styled-bootstrap-responsive-breakpoints';
import { Container, Row, Col } from 'react-bootstrap';


const Styles = styled.div`

`

export default function Hours() {
    return (
        <Styles className= "border border-danger h-100" >
            <ul>
                <li>9.00 - 9.30</li>
                <li>9.30 - 10.00</li>
                <li>10.00 - 10.30</li>
                <li>10.30 - 11.00</li>
                <li>11.00 - 11.30</li>
                <li>11.30 - 12.00</li>
                <li>12.00 - 12.30</li>
                <li>12.30 - 13.00</li>
                <li>13.00 - 13.30</li>
                <li>13.30 - 14.00</li>
                <li>14.00 - 14.30</li>
                <li>14.30 - 15.00</li>
                <li>15.00 - 15.30</li>
                <li>15.30 - 16.00</li>
                <li>16.00 - 16.30</li>
                <li>16.30 - 17.00</li>
                <li>17.00 - 17.30</li>
            </ul>
        </Styles>
    );
}
